var base64Encoder = {
  chars: "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/",
  n: 76,
  encode: function(b) {
    var s = this.chars
    var c = ""
    var b1, b2, b3, b4
    for (var i = 0; b.length > i; i += 3) {
      b1 = (b[i] & 0xfc) >> 2
      c += s.charAt(b1)
      if (b.length > i + 1) {
        b2 = ((b[i] & 0x03) << 4) | ((b[i + 1] & 0xf0) >> 4)
        c += s.charAt(b2)
        if (b.length > i + 2) {
          b3 = ((b[i + 1] & 0x0f) << 2) | ((b[i + 2] & 0xc0) >> 6)
          b4 = b[i + 2] & 0x3f
          c += s.charAt(b3) + s.charAt(b4)
        } else {
          b3 = (b[i + 1] & 0x0f) << 2
          c += s.charAt(b3) + "="
        }
      } else {
        b2 = (b[i] & 0x03) << 4
        c += s.charAt(b2) + "=="
      }
    }
    var str = ""
    var n = this.n
    if (n >= 1) {
      for (var i = 0; c.length > i; i += n) {
        str += c.substring(i, i + n) + "\n"
      }
      str = str.replace(/\n+$/, "")
    } else {
      str = c
    }
    return str
  },
  decode: function(c) {
    var s = this.chars
    var b = []
    c = c.replace(/[\r\n]+/g, "")
    var c1, c2, c3, c4
    for (var i = 0; c.length > i; i += 4) {
      c1 = s.indexOf(c.charAt(i))
      c2 = s.indexOf(c.charAt(i + 1))
      c3 = s.indexOf(c.charAt(i + 2))
      c4 = s.indexOf(c.charAt(i + 3))
      b.push(((c1 & 0x3f) << 2) | (c2 >> 4))
      if (c3 >= 0) {
        b.push(((c2 & 0x0f) << 4) | (c3 >> 2))
        if (c4 >= 0) {
          b.push(((c3 & 0x03) << 6) | c4)
        }
      }
    }
    return b
  },
}

var src =
  "data:image/jpeg;base64,"
var canvas = document.getElementById("canvas")
var ctx = canvas.getContext("2d")
var image = new Image()
image.src = src

var threshold = 0.8
document.getElementById("th").addEventListener(
  "change",
  function() {
    threshold = document.getElementById("th").value
  },
  false
)

image.onload = function() {
  ctx.drawImage(image, 0, 0)
  baseSource = canvas
    .toDataURL("image/jpeg")
    .split("data:image/jpeg;base64,")[1]
}

var b64 = base64Encoder
var ng = [1, 2, 3, 4, 6, 7, 8, 9, 12, 16, 17, 24, 29, 34]
var glitch = function() {
  var random
  var indexGene = function() {
    random = [parseInt(Math.random() * 100), parseInt(Math.random() * 100)]
    for (var i = 0; i < ng.length; i++) {
      if (random[0] == ng[i]) {
        indexGene()
      }
    }
  }
  indexGene()

  var binary = b64.decode(baseSource)
  for (var i = 0; i < binary.length; i++) {
    if (binary[i] == random[0] && Math.random() > threshold) {
      binary[i] = random[1]
    }
  }
  var outSource = b64.encode(binary)
  document.getElementById("out").src = "data:image/jpeg;base64," + outSource
}

setInterval(function() {
  glitch()
}, 30)
